import React from 'react';
import Navbar1 from '../Layout/Navbar1';
import { Link } from 'react-router-dom';
import {Container} from 'react-bootstrap';
import './Homepage.css';
function Homepage() {
    const backgroundImageUrl="C:\Users\kolshikwar.aishwarya\Desktop\Employee-Management-Frontend\employee-management-system-frontend\src\Pages\download.png";

    return (
        <div>
          <Navbar1></Navbar1>
          <Container fluid style={{backgroundImage:'url(${backgroundImageUrl})'}}></Container>
        </div>
    );
}

export default Homepage;
